import './App.css';
import './index.css';
import Navbar from './Navbar';
import Home from './home';
import {BrowserRouter, Switch, Route} from 'react-router-dom';
function App() {
  return (
    <div className="bg-secondary">
      <BrowserRouter>
      <Navbar className="mt-12" />

      <Switch>

        <Route path="/home" exact>
        <Home/>
        </Route>

      </Switch>
      </BrowserRouter>

    </div>
  );
}

export default App;
